import React from 'react';

function PDFViewer(props){
  let currentCard = props.currentCard;
  return (
    <div className="PDFViewer">
      <div className="PDFViewerText">
        <div className="PDFViewerMainText">
          <p>{currentCard.name} (<span>{currentCard.age}</span>)</p>
        </div>
        <div classNAme="PDFViewerSubText">
          <p>{currentCard.job} <span>{currentCard.japaneseName}</span></p>
        </div>
      </div>
      <div className="PDFViewerShadow"></div>
      <img className="PDFViewerImage" alt="Background for PDF" src={currentCard.image} />
    </div>
  )
}

export default PDFViewer;
